import BarChart from "../ChartsFolder/BarChart";
import "../ChartsFolder/ChartStyles.css";
import Sxvaoba from "../ChartsFolder/SxvaobaChart";
import ContentHeader from "../ContentHeader/ContentHeader";
import "./mainPage.css";
function MainPage(props) {
  return (
    <div>
      <ContentHeader />
      <form className="inputContainer">
        <input
          type={"number"}
          id="A"
          placeholder="A"
        />
      <input
          type={"number"}
          id="B"
          placeholder="B"
        />
      </form>

      <div className="chartGraphs">
        <div className="BarChartAll">
          <BarChart sabolooMoxmareba={props.sabolooMoxmareba} />
        </div>
        <div className="BarChartAll">
          <Sxvaoba sabolooMoxmareba={props.sabolooMoxmareba} />
        </div>
      </div>
    </div>
  );
}

export default MainPage;
